    const tab: string = "marketing-tools"

    let features: any[] = [
        {
            title: 'Tailored Content Platform',
            is_active: true,
            image_url: '/images/marketing-tools-image3.jpg',
            description: 'Built from the ground up specifically for the music industry, Tapp StoryTeller Suite offers a unique content platform that enhances artist-fan engagement. Every feature is designed with musicians and their audiences in mind, ensuring that your storytelling resonates deeply and effectively connects with fans.'
        },
        {
            title: 'AI Supercharged Tools',
            is_active: false,
            image_url: '/images/marketing-tools-image3.jpg',
            description: 'Harness the power of AI across all facets of artist-fan interaction. From crafting compelling stories and planning content to promoting and sharing, our AI-driven tools streamline and elevate each step of the engagement process, making it easier than ever to captivate and grow your audience.'
        },
        {
            title: 'Advanced Analytics and Insights',
            is_active: false,
            image_url: '/images/marketing-tools-image3.jpg',
            description: `Gain valuable insights into your content&lsquo;s performance with advanced analytics. Tappi Storyteller Suite provides detailed metrics and trends, helping you understand your audience&lsquo;s preferences, optimize your storytelling strategies, and make intelligent decisions to enhance your fan engagement.`
        },
    ]


    const [features_arr, SetFeatureArr] = useState<any[]>(features)

    const swiperRef = useRef<any>(null);

    const selectSlide = (index: number) => {
        if (swiperRef.current && swiperRef.current.swiper) {
            SetFeatureArr(prevFeatures =>
                prevFeatures.map((obj, i) => ({
                    ...obj, // Spread the object properties
                    is_active: i === index // Set `is_active` to true for the selected slide, false for others
                }))
            );
            swiperRef.current.swiper.slideTo(index);

        }
    };

